function searchCard() {
  var card = document.getElementById('userid').value;
  if(chkCard(card)) {
    var url = location.href;
    if(url.indexOf('?card=')!=-1) {
      var info = url.split('?card=');
      url = info[0];
    }
    location.href=url+'?card='+card;
  }else {
    alert('请输入15或18位正确的身份证号码');
  }
}

function chkCard(card) {
  if(card.length == 15 || card.length == 18){
    var tmp = card;
    if(card.length == 18) {      
      card = tmp.substr(0,17);
    }
    if(!isNaN(card)) {
      return true;
    }
  }
  return false;
}